import React from "react";
import { Row, Col, Divider, Icon, Card, Avatar } from "antd";
const { Meta } = Card;

const ListCard = ({ data, handleDelete, handleShowModal }) => {
  return (
    <Row gutter={2}>
      <Divider />

      {data.map(order => (
        <Col span={6}>
          <Card
            key={order.id}
            title={order.table_number}
            cover={<img alt="" src={order.url} />}
            style={{
              height: "200px",
              margin: "1em 1em"
            }}
            actions={[
              <Icon type="delete" onClick={() => handleDelete(order.id)} />,
              <Icon type="edit" onClick={() => handleShowModal(order)} />
            ]}
          >
            <Meta
              avatar={<Avatar>{order.name}</Avatar>}
              title={order.name}
              description={order.order}
            />
          </Card>
        </Col>
      ))}
    </Row>
  );
};

export default ListCard;
